import pandas as pd
import tkinter as tk
from tkinter import filedialog, messagebox
import subprocess
import sys
import os
from PIL import Image, ImageTk
import base64
from io import BytesIO

# ====== اللوجو Base64 ======
logo_base64 = """

"""  # هنا تحط Base64 للصورة لو عندك

def get_logo_image():
    try:
        if logo_base64.strip() == "":
            return None
        img_data = base64.b64decode(logo_base64)
        image = Image.open(BytesIO(img_data))
        image = image.resize((120, 120))
        return ImageTk.PhotoImage(image)
    except:
        return None

# ====== وظائف البرنامج ======
def run_custom_script():
    script_path = r"D:\exports\complete_advanced_search.py"
    if os.path.exists(script_path):
        try:
            subprocess.run([sys.executable, script_path], check=True)
            messagebox.showinfo("تم", f"تم تشغيل {script_path} بنجاح")
        except Exception as e:
            messagebox.showerror("Error", f"حصل خطأ:\n{e}")
    else:
        messagebox.showerror("Error", f"الملف {script_path} مش موجود!")


def merge_csvs():
    file_paths = filedialog.askopenfilenames(filetypes=[("CSV files", "*.csv")])
    if not file_paths:
        return
    combined_data = []
    try:
        for file_path in file_paths:
            df = pd.read_csv(file_path)
            if "Subscriber ID" in df.columns:
                combined_data.append(df["Subscriber ID"])
            else:
                messagebox.showerror("خطأ", f"العمود 'Subscriber ID' مش موجود في الملف: {file_path}")
                return
        merged_series = pd.concat(combined_data, ignore_index=True).drop_duplicates()
        result_df = pd.DataFrame({"Subscriber ID": merged_series})
        save_path = filedialog.asksaveasfilename(defaultextension=".csv",
                                                 filetypes=[("CSV files", "*.csv")])
        if save_path:
            result_df.to_csv(save_path, index=False)
            messagebox.showinfo("تم الحفظ", f"تم إنشاء ملف جديد:\n{save_path}")
    except Exception as e:
        messagebox.showerror("Error", f"حصل خطأ:\n{e}")

# ====== الواجهة ======
root = tk.Tk()
root.title("Huawei handover")
root.geometry("600x500")

title_label = tk.Label(root, text="Huawei Handover", font=("Arial", 24, "bold"), fg="darkred")
title_label.pack(pady=20)

logo_photo = get_logo_image()
if logo_photo:
    logo_label = tk.Label(root, image=logo_photo)
    logo_label.pack(pady=10)

btn1 = tk.Button(root, text="Export Client Versions sheets from ISEE", command=run_custom_script,
                 width=50, height=2, font=("Arial", 14))
btn1.pack(pady=20)

btn2 = tk.Button(root, text="Merge and remove duplicates for subscribers", command=merge_csvs,
                 width=50, height=2, font=("Arial", 14))
btn2.pack(pady=20)

root.mainloop()
